import React from 'react';
import PropTypes from 'prop-types';
import './skl-ds-widget.css';

import { Icon } from './../../atoms/skl-ds-icon/skl-ds-icon';
import { Text } from './../../atoms/skl-ds-icon/skl-ds-icon';

export const Widget = ({ icon })=> {


  return <div className="skl-ds-widget">
    <Icon iconName={icon}/>

  </div>;
};

Text.propTypes = {
  icon: PropTypes.oneOf(['alarm', 'chat', 'check', 'child_care', 'close', 'favorite', 'handyman']).isRequired,
  size: PropTypes.oneOf(['small', 'medium']),
  color: PropTypes.oneOf(['white', 'black']),
  children: PropTypes.node.isRequired,
};

Text.defaultProps = {
  tag: 'p',
  color: 'black',
  size: "small",
  bold: false
};
